import Menu from './Menulayout'
import  $ from 'jquery'

function Search() {
    $(function() {
	
        $('.rrr').draggable();
        
    });
    return (<>
    <div clasName="mmm">
        <div class="rrr">1</div>
        <div>2</div>
        <div>3</div>
        <div>4</div>
        <div>5</div>
    </div>
    </>)

}
export default Search;
